	function Update-ADGroups
	{
		$lstADGroups.Items.Clear()
		
		try
		{
			if ($RemoteADModule)
			{
				$UserObject = Invoke-Command -Session $Session -ScriptBlock {
					Param ($Username)
					Import-Module ActiveDirectory
					Get-ADUser $Username -Properties MemberOf, DisplayName, Department, Description, mail -ErrorAction Stop
				} -ArgumentList $txtUsername.Text
				
				$MemberOf = $UserObject.MemberOf | Sort-Object
				foreach ($group in $MemberOf)
				{
					Update-ListBox $lstADGroups (Invoke-Command -Session $Session -ScriptBlock {
							Param ($GroupName)
							Import-Module ActiveDirectory
							Get-ADGroup $GroupName
					} -ArgumentList $group) "Name" -Append
				}
			}
			else
			{
				$UserObject = Get-ADUser $txtUsername.Text -Properties MemberOf, DisplayName, Department, Description, mail -Credential $cred -ErrorAction Stop
				$MemberOf = $UserObject.MemberOf | Sort-Object
				foreach ($group in $MemberOf)
				{
					Update-ListBox $lstADGroups (Get-ADGroup $group -Credential $cred) "Name" -Append
				}
			}
					
			$txtDisplayname.Text = $UserObject.DisplayName
			$txtDepartment.Text = $UserObject.Department
			$txtFunction.Text = $UserObject.Description
			$txtSamAccountName.Text = $UserObject.SamAccountName
			$txtUserPrincipalName.Text = $UserObject.UserPrincipalName
			$txtEmailAddress.Text = $UserObject.mail
			return $true
		}
		catch
		{
			return $false
		}
	}
	
	function Update-ADGroupMembership
	{
		$lstGroupMembership.Items.Clear()
		
		try
		{
			if ($RemoteADModule)
			{
				$GroupObject = Invoke-Command -Session $Session -ScriptBlock {
					Param ($Groupname)
					Import-Module ActiveDirectory
					Get-ADGroup -Identity $Groupname -Properties * -ErrorAction Stop
				} -ArgumentList $GRPtxtGroupname.Text
				
				$ManagedByGroupObject = Invoke-Command -Session $Session -ScriptBlock {
					Param ($Groupname)
					Import-Module ActiveDirectory
					Get-ADGroup -Identity $Groupname -Properties * -ErrorAction Stop
				} -ArgumentList $GroupObject.ManagedBy
				
				$GroupMemberObject = Invoke-Command -Session $Session -ScriptBlock {
					Param ($Groupname)
					Import-Module ActiveDirectory
					Get-ADGroupMember -Identity $Groupname -Properties * -ErrorAction Stop | Sort-Object Name
				} -ArgumentList $GRPtxtGroupname.Text
			}
			else
			{
				$GroupObject = Get-ADGroup -Identity $GRPtxtGroupname.Text -Property * -ErrorAction Stop
				$ManagedByGroupObject = Get-ADGroup -Identity $GroupObject.ManagedBy -Property * -ErrorAction Stop
				$GroupMemberObject = Get-ADGroupMember -Identity $GRPtxtGroupname.Text -ErrorAction Stop | Sort-Object Name
			}
			
			$DirectMemberCount = ($GroupMemberObject | Where-Object { $_.ObjectClass -eq 'user' }).Count
			$NestedGroupCount = ($GroupMemberObject | Where-Object { $_.ObjectClass -eq 'group' }).Count
			
			### Fill Members Listbox
			Update-ListBox $lstGroupMembership $GroupMemberObject "Name"
			
			### Fill Group Details
			$GRPtxtDisplayname.Text = $GroupObject.CN
			$GRPtxtGroupCategory.Text = $GroupObject.GroupCategory
			$GRPtxtGroupScope.Text = $GroupObject.GroupScope
			$GRPtxtGroupInfo.Text = $GroupObject.Info
			$GRPtxtManagedBy.Text = $ManagedByGroupObject.CN
			$GRPtxtDirectMemberCount.Text = $DirectMemberCount
			$GRPtxtNestedGroupsCount.Text = $NestedGroupCount
			return $true
		}
		catch
		{
			return $false
		}
	}
