	$btnRetrieve_Click={
		#TODO: Place custom script here
		$rtbAddOutput.Clear()
		$lstAddADGroups.SelectedItems.Clear()
		
		if ([string]::IsNullOrEmpty($txtADGroup.Text))
		{
			$rtbAddOutput.SelectionFont = $FontBold
			$rtbAddOutput.SelectionColor = 'Orange'
			$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
			$rtbAddOutput.SelectionFont = $FontRegular
			$rtbAddOutput.AppendText(" $($LanguageStrings.AFNoADGroup)`r`n")
			
			$txtADGroup.Focus()
			Paint-FocusBorder $txtADGroup
		}
		else
		{
			try
			{
				$searchstring = "$($txtADGroup.Text)*"
				if ($RemoteADModule)
				{
					$ADgroups = Invoke-Command -Session $Session -ScriptBlock {
						Param ($search)
						Import-Module ActiveDirectory
						Get-ADGroup -Filter { Name -like $search } -ErrorAction Stop #| Select-Object -ExpandProperty Name
					} -ArgumentList $searchstring
				}
				else
				{
					$ADgroups = Get-ADGroup -Filter { Name -like $searchstring } -Credential $cred -ErrorAction Stop #| Select-Object -ExpandProperty Name
				}
				
				
				$rtbAddOutput.SelectionFont = $FontBold
				$rtbAddOutput.AppendText("$($LanguageStrings.VBInfo)")
				$rtbAddOutput.SelectionFont = $FontRegular
				$rtbAddOutput.AppendText(" $($LanguageStrings.AFADGroupFound) ")
				$rtbAddOutput.SelectionFont = $FontBoldItalic
				$rtbAddOutput.AppendText("$($searchstring)`r`n")
				Paint-FocusBorder $txtADGroup
							
				Update-ListBox $lstAddADGroups $ADgroups "Name"
			}
			catch
			{
				$rtbAddOutput.SelectionFont = $FontBold
				$rtbAddOutput.SelectionColor = 'Red'
				$rtbAddOutput.AppendText("$($LanguageStrings.VBError)")
				$rtbAddOutput.SelectionFont = $FontRegular
				$rtbAddOutput.AppendText(" $($LanguageStrings.AFADGroupInvalid) ")
				$rtbAddOutput.SelectionFont = $FontBoldItalic
				$rtbAddOutput.AppendText($txtADGroup.Text)
				$btnAdd.Enabled = $false
				$txtADGroup.Focus()
				Paint-FocusBorder $txtADGroup
			}			
		}
	}
	
	$btnAgain_Click = {
		#TODO: Place custom script here
		$btnAdd.Enabled = $false
		$txtADGroup.Clear()
		$lstAddADGroups.Items.Clear()
		$lstGroupsToBeAdded.Items.Clear()
		$txtADGroup.Focus
		Paint-FocusBorder $txtADGroup
	}
	
	$btnRight_Click = {
		#TODO: Place custom script here
		if ($lstAddADGroups.SelectedItems -ne 0)
		{
			foreach ($i in $lstAddADGroups.SelectedItems)
			{
				if (!($script:GroupsToBeAdded -contains $i.Name))
				{
					Update-ListBox $lstGroupsToBeAdded $i.Name -Append
					$script:GroupsToBeAdded += $i.Name
					$btnAdd.Enabled = $true
				}
				else
				{
					$rtbAddOutput.SelectionFont = $FontBold
					$rtbAddOutput.SelectionColor = 'Orange'
					$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
					$rtbAddOutput.SelectionFont = $FontRegular
					$rtbAddOutput.AppendText(" $($LanguageStrings.VBGroupAlreadyAdded)`r`n")
				}
			}
		}
		else
		{
			$rtbAddOutput.SelectionFont = $FontBold
			$rtbAddOutput.SelectionColor = 'Orange'
			$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
			$rtbAddOutput.SelectionFont = $FontRegular
			$rtbAddOutput.AppendText(" $($LanguageStrings.VBNoGroup)`r`n")
			$btnAdd.Enabled = $false
		}
	}
	
	$btnLeft_Click = {
		#TODO: Place custom script here
		if ($lstGroupsToBeAdded.SelectedItems -ne 0)
		{
			foreach ($i in $lstGroupsToBeAdded.SelectedItems)
			{
				$script:GroupsToBeAdded = $GroupsToBeAdded | Where-Object { $_ -ne $i }
			}
			
			for ($i = $lstGroupsToBeAdded.SelectedItems.Count - 1; $i -ge 0; $i--)
			{
				$lstGroupsToBeAdded.Items.Remove($lstGroupsToBeAdded.SelectedItems[$i])
			}
		}
		else
		{
			$rtbAddOutput.SelectionFont = $FontBold
			$rtbAddOutput.SelectionColor = 'Orange'
			$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
			$rtbAddOutput.SelectionFont = $FontRegular
			$rtbAddOutput.AppendText(" $($LanguageStrings.VBNoGroup)`r`n")
			$btnAdd.Enabled = $false
		}
	}
	
	$txtADGroup_KeyDown=[System.Windows.Forms.KeyEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.KeyEventArgs]
		#TODO: Place custom script here
		if ($_.KeyCode -eq "Enter")
		{
			$btnRetrieve_Click.Invoke()
			$btnRetrieve.Focus()
			Paint-FocusBorder $txtADGroup
		}
	}
