	#region Mouse Click Controls
	$lstAddADGroups_MouseDoubleClick = [System.Windows.Forms.MouseEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.MouseEventArgs]
		#TODO: Place custom script here
		$btnAdd.Enabled = $true
		Update-ListBox $lstGroupsToBeAdded ($lstAddADGroups.SelectedItem).Name -Append
		$script:GroupsToBeAdded += ($lstAddADGroups.SelectedItem).Name
	}
	
	$lstGroupsToBeAdded_MouseDoubleClick=[System.Windows.Forms.MouseEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.MouseEventArgs]
		#TODO: Place custom script here
		
		$script:GroupsToBeAdded = $GroupsToBeAdded | Where-Object { $_ -ne $lstGroupsToBeAdded.SelectedItem }
		$lstGroupsToBeAdded.Items.Remove($lstGroupsToBeAdded.SelectedItem)
	}
	#endregion
	
	#region Selection Controls
	$lstGroupsToBeAdded_KeyDown=[System.Windows.Forms.KeyEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.KeyEventArgs]
		#TODO: Place custom script here
		if ($_.Control -and $_.KeyCode -eq 'V')
		{
			$ClipBoardContents = [System.Windows.Forms.Clipboard]::GetText()
			
			if ([string]::IsNullOrEmpty($ClipBoardContents))
			{
				$rtbAddOutput.SelectionFont = $FontBold
				$rtbAddOutput.SelectionColor = 'Orange'
				$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
				$rtbAddOutput.SelectionFont = $FontRegular
				$rtbAddOutput.AppendText(" $($LanguageStrings.VBNoCBContent)`r`n")
			}
			else
			{
				$ClipBoardContents = ($ClipBoardContents -split '\r?\n').Trim()
				foreach ($i in $ClipBoardContents)
				{
					if ($null -ne $_)
					{
						Update-ListBox $lstGroupsToBeAdded $i -Append
						$script:GroupsToBeAdded += $i
					}
				}
				
				$rtbOutput.SelectionFont = $FontBold
				$rtbOutput.AppendText("$($LanguageStrings.VBInfo)")
				$rtbOutput.SelectionFont = $FontRegular
				$rtbOutput.AppendText(" $($LanguageStrings.VBCBPasted)`r`n")
				
				$btnAdd.Enabled = $true
			}
		}
	}
	
	$lstAddADGroups_KeyDown=[System.Windows.Forms.KeyEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.KeyEventArgs]
		#TODO: Place custom script here
		if ($_.Control -and $_.KeyCode -eq 'A')
		{
			$_.SuppressKeyPress = $true
			[int]$i = 0
			while ($i -lt $lstAddADGroups.Items.Count)
			{
				$lstAddADGroups.SetSelected($i, $true)
				$i++
			}
		}
		
		if ($_.Control -and $_.KeyCode -eq 'C')
		{
			#$rtbOutput.Clear()
			if ($lstAddADGroups.SelectedItems.Count -eq 0)
			{
				$rtbAddOutput.SelectionFont = $FontBold
				$rtbAddOutput.SelectionColor = 'Orange'
				$rtbAddOutput.AppendText("$($LanguageStrings.VBWarning)")
				$rtbAddOutput.SelectionFont = $FontRegular
				$rtbAddOutput.AppendText(" $($LanguageStrings.VBNoGroup)`r`n")
			}
			else
			{
				$txt = ($lstAddADGroups.SelectedItems).Name | Out-String
				[System.Windows.Forms.Clipboard]::SetText($txt)
				#$lstADGroups.ClearSelected()
				$rtbAddOutput.SelectionFont = $FontBold
				$rtbAddOutput.SelectionColor = 'Green'
				$rtbAddOutput.AppendText("$($LanguageStrings.VBSuccess)")
				$rtbAddOutput.SelectionFont = $FontRegular
				$rtbAddOutput.SelectionColor = 'Black'
				$rtbAddOutput.AppendText(" $($LanguageStrings.VBGroupsCopied)`r`n")
			}
		}
	}
